if __name__ == '__main__':
        
    import re

    # Initialize lists for buildings and amenities
    building_list = []
    amenity_list = []

    # Compile the pattern to match 'building' or 'amenity' keys with any values
    pattern = re.compile(r'"(building|amenity)=([^"]+)"')

    with open('data/small.json', 'r') as file:
        for line in file:
            matches = pattern.findall(line)
            for match in matches:
                # Clean the value by removing unwanted characters
                cleaned_value = match[1].replace('\"', '').replace(',', '').replace('\'', '').replace('_', ' ')

                # Append to the correct list based on whether it's a building or amenity
                if match[0] == 'building':
                    building_list.append(cleaned_value)
                elif match[0] == 'amenity':
                    amenity_list.append(cleaned_value)

    # Output unique entries for both lists
    print("Buildings:", set(building_list))
    print("Amenities:", set(amenity_list))
